	public static int lengthOfLongestSubstring(String source) {
		if(source == null) {
			return 0;
		}

		int i = 0, j = 0, maxLength = 0, len = source.length();
		Map<Character, Integer> map = new HashMap<Character, Integer>();
		
		while(i < len && j < len) {
			if(!map.containsKey(source.charAt(j))) {
				map.put(source.charAt(j), j);
				maxLength = Math.max(maxLength, ++j - i);
			} else {
				int index = map.get(source.charAt(j));
				for(int k = i; k <= index; k++) {
					map.remove(source.charAt(k));
				}
				i = index + 1;
			}
		}
		
		return maxLength;
	}
